// IncorrectQuestionsScreen.js

import React from 'react';
import { StyleSheet, View } from 'react-native';
import Button from '../components/Button';
import Background from '../components/Background';
import IncorrectQuiz from '../components/IncorrectQuiz'; // Import the IncorrectQuiz component

export default function IncorrectQuestionsScreen({ navigation, route }) {
    return (
        <Background>
            <View style={styles.container}>
                <IncorrectQuiz navigation={navigation} />
                <Button
                    color="black"
                    mode="contained"
                    onPress={() => navigation.navigate('QuizEndingScreen')}
                >
                    Continue
                </Button>
            </View>
        </Background>
    );
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        justifyContent: 'center',
        alignItems: 'center',
    },
});
